import React from "react";
import Carousel from "react-bootstrap/Carousel";
import Brands from "../../data/BrandsData"


const CarouselBrands = () => {


    return (
        <div>
            <Carousel interval="1000">
                {
                    Brands.map(brand => {
                        return (
                            <Carousel.Item>
                                <img
                                className="w100"
                                src={brand.src}
                                alt={brand.title}
                                />
                            </Carousel.Item>
                        );
                    })   
                }
            </Carousel>
        </div>
    );
};


export default CarouselBrands;
